    const beginQuery = () => {

      fetch(`http://127.0.0.1:8000/trick`).then((res => res.json())).then(dataobject => {
        setData(dataobject);
        setTrick(dataobject["Prediction"]);
        setConf(dataobject["Accuracy"]);

        // setVisible(true)
      })
    }


    if (true) {
      return (
          <div>
            <h2>{trick} detected with {conf} accuracy!</h2>
            <button onClick={ () => beginQuery()}>Make get request</button>
          </div>
        );
    } else {
        return (<div></div>);
    }


};

